import React from 'react';
import UserNav from '../../components/navigation/UserNav';


const History = () => (
    <div className="container-fluid">
        <div className="row">
            <div className="col-md-2">
                <UserNav />
            </div>
            <div className="col">user History page</div>
        </div>
    </div>
);

export default History;
